Given the code fragment:
Map<Integer, String> books = new TreeMap<>();
books.put (1007, "A");
books.put (1002, "C");
books.put (1003, "B");
books.put (1003, "B");
System.out.println (books);
What is the result?

discussion.content:
Selected Answer: D
D is true as TreeMap sorts in natural order by key. Also if last line of insertion was replaced by books.put (1003, "D");
then that would be printed.

